  false,\n\t\"url\": null,\n\t\"notes\": \"Upwelling index computed from 1-degree
  FNMOC sea level pressure for 15 locations off the North American West Coast at each
  3 degrees of latitude from 21N to 60N. The coastal Upwelling Index is an index of
  the strength of the wind forcing on the ocean which has been used in many studies
  of the effects of ocean variability on the reproductive and recruitment success
